description:
English | CBZ and CBR | 23 Issues

With this Youngblood filler pack, the Youngblood v1, v2, v3, v4, and v5 torrents, you should have a complete set of Youngblood comics minus two comics:
Youngblood: Bloodsport 2002 Convention Preview Edition (June 2002)
Youngblood: Bloodsport #2 (August 2003)

The following titles are included (in chronological order by release date):
Youngblood Yearbook #1 (1993) [Image COmics]
Youngblood Strikefile #1-11 (1993-1995) [Image Comics]
* Youngblood Strikefile #6, page 20 is corrupt.
Extremely Youngblood #1 (1996) [Image Comics]
Youngblood Super Special #1 (1997) [Maximum Press]
Youngblood Battlezone #1-2 (1993-1994) [Image Comics]
Youngblood/X-Force #1 (1996) [Image Comics]
X-Force/Youngblood #1 (1996) [Image Comics]
Youngblood Gt Interactive Ultra Game Players Special Edition (1998) [Awesome Comics]
Youngblood: Bloodsport #1 (2003) [Arcade Comics]
Youngblood Genesis #1-2 (2003-2004) [Arcade Comics]
Youngblood Imperial #1 (2004) [Arcade Comics]

